import React, { Component } from "react";

class PRODUCTOS extends Component {
  render() {
    const { productos } = this.props;
    return (
      <div>
        <ul className="ulFlex">
          {productos.map((el) => (
            <li key={el.img}>{el.name}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default PRODUCTOS;
